// src/plugins/vuetify.js

import Vue from 'vue'
import Vuetify from 'vuetify/lib'

Vue.use(Vuetify)

const vuetify = new Vuetify({
    theme: {
        themes: {
            light: {
                primary: '#3f51b5',
                secondary: '#b0bec5',
                anchor: '#8c9eff',
            },
            dark: {
                primary: '#f44336',
                secondary: '#b0bec5',
                anchor: '#8c9eff',
            },
        },
    },
})

export default vuetify
